import React from 'react';
import Gallery from './Gallery';
import Posts from './Posts';
import contentStyles from './Content.module.css';

function Content() {
  let posts = [
    {
      message: `Hello my name is Mary and I am a web developer. I am a second year student at the Warsaw University of Technology. This social network dedicated to me was written fully on React JS 
      Lorem ipsum, dolor sit amet consectetur adipisicing elit. Officiis, iste!`,
      id: 1
    },
    {
      message: 'I am web developer',
      id: 2
    }
  ];

  let postsElements = posts.map(p => <Posts message={p.message}/>);
  return (

      <div className={contentStyles.mainContent}>
          {postsElements}
          <Gallery /> 
      </div>

  );
}

export default Content;
